  true,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selectedn               geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencingn               (MAF/TIGER) Database (MTDB).
  \ The MTDB represents a seamless national file with no overlaps or gaps between
  parts, however, each TIGER/Line shapefile isn               designed to stand alone
  as an independent data set, or they can be combined to cover the entire nation.
  \ Primary roads are generally divided,n               limited-access highways within
  the interstate highway system or under State management, and are distinguished by
  the presence of interchanges.  Thesen               highways are accessible by ramps
  and may include some toll highways.  The MAF/TIGER Feature Classification Code (MTFCC)
  is S1100 for primary roads.n               Secondary roads are main arteries, usually
  in the U.S. Highway, State Highway, and/or County Highway system.  These roads have
  one or more lanes ofn               traffic in each direction, may or may not be
  divided, and usually have at-grade intersections with many other roads and driveways.
  \ They usually haven               both a local name and a route number.  The MAF/TIGER
  Feature Classification Code (MTFCC) is S1200 for secondary roads.\",\n\t\"license_title\":
